//Package sprites provides access to the different sprites generated by
//the application (i.e: stars, planets)
package sprites

import (
	"bytes"
	"encoding/base64"
	"image"
	"image/png"
	"math/rand"
)

type Size uint8

const (
	Small Size = iota
	Medium
	Large
)

func GetSprite(spriteSize Size) (sprite image.Image) {
	var targetSlice []string

	if spriteSize == Small {
		targetSlice = smallSprites[:]
	} else if spriteSize == Medium {
		targetSlice = mediumSprites[:]
	} else { //spriteSize == Large
		targetSlice = bigSprites[:]
	}

	index := rand.Intn(len(targetSlice))
	return base64ToPng(targetSlice[index])
}

func base64ToPng(b64string string) image.Image {

	// Turn the string back into the original byte array
	originalData, _ := base64.StdEncoding.DecodeString(b64string)

	// Instead of a file descriptor to a file, get a "file descriptor" to the byte slice
	reader := bytes.NewReader(originalData)

	// create the in memory structure of the image
	img, _ := png.Decode(reader)

	return img
}

